- input: "TEXT\x1CC00161786\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commissions Request for Further Information dated 2/28/2013 regarding the
    ASDC - Dollars for Democrats Memo reported on Schedule A, a transfer not reported
    by another committee, and Travel Per Diem disclosed on Schedule H4.  1.) The Memo
    reported on Line 11(a)(ii) for Schedule A from the ASDC - Dollars for Democrats
    represents un-itemized contributions from the Joint Fundraising Committee.  This
    has been clarified on this amendment.  2.) The transfer originally reported from
    the Democratic National Committee was a data entry error.  The transfer was actually
    an unlimited transfer from the Obama for America committee and has been corrected
    on this amended report.  All subsequent reports will be amended to correct the
    Detailed Summary Pages.  3.) Please note that the payment(s) identified as Travel
    Per Diem on Schedule H4 were not cash payments.  Furthermore, these payments were
    bi-weekly Travel Per Diem payments in accordance with policies of the committee
    and not a reimbursement for any specific travel expense.  Please note that the
    employees that were disclosed on Schedule H4 supporting Line 21 and Schedule B
    supporting Line 21(b) as payroll spent less than 25% of their time during the
    period working on Federal Election Activity or activities in connection with a
    Federal Election.  This also includes fringe benefits for those specific employees.
    \ -   Please note that all fundraising activity on this report was for the sole
    benefit of the Committee and was not attributable to any candidate for federal
    office.  No national party transfers were used on any activity that meets the
    definition of exempt.  -   Memo Schedule A's that itemize the committees share
    of the gross contributions received through the joint fundraising activities from
    the ASDC Dollars for Democrats and/or the DNC Victory Fund (Democratic National
    Committee), Swing State Victory Fund, Obama Victory Fund are provided on a quarterly
    basis. The transfer of the joint fundraising proceeds received during this reporting
    period represents the committee's share of proceeds for contributions received
    during this or prior reporting periods. The memo entries for these contributions
    are included in this or a prior report of the committee. -  Please note that all
    contributions with addresses from outside of the United States have been verified
    and are permissible funds.\n"
